package main

import (
	"bytes"
	"encoding/base64"
	"io"
	"net/http"
	"os"
)

func handle103(w http.ResponseWriter, r *http.Request) {
	if r.Method == "GET" {
		hj, ok := w.(http.Hijacker)
		if !ok {
			os.Exit(2)
		}
		conn, bufrw, err := hj.Hijack()
		if err != nil {
			http.Error(w, err.Error(), http.StatusInternalServerError)
			return
		}
		defer conn.Close()
		bufrw.WriteString("HTTP/1.1 103 Early Hints\r\n" +
			"Link: </alpaca1>; rel=preload; as=image\r\n\r\n" +
			"HTTP/1.1 103 Early Hints\r\n" +
			"Link: </alpaca_flag>; rel=preload; as=script\r\n" +
			"Link: </alpaca2>; rel=preload; as=image\r\n\r\n" +
			"HTTP/1.1 200 OK\r\n" +
			"Content-Type: text/plain; charset=utf-8\r\n" +
			"You should look at /alpaca1 and /alpaca2.")
		bufrw.Flush()
	} else {
		http.Error(w, http.StatusText(405), 405)
	}
}

func handleIndex(w http.ResponseWriter, r *http.Request) {
	io.WriteString(w, "You should look at /alpaca1 and /alpaca2. If you have a really recent^W^Wfuturistic browser maybe you should also look at /http_103_code")
}

func handleAlpaca1(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "image/jpeg")
	img, _ := base64.StdEncoding.DecodeString(alpaca1)
	io.Copy(w, bytes.NewReader(img))
}

func handleAlpaca2(w http.ResponseWriter, r *http.Request) {
	w.Header().Set("Content-Type", "image/jpeg")
	img, _ := base64.StdEncoding.DecodeString(alpaca2)
	io.Copy(w, bytes.NewReader(img))
}

func handleFlag(w http.ResponseWriter, r *http.Request) {
	io.WriteString(w, "GH17{yeah_I_like_alpacas}")
}

func main() {
	http.HandleFunc("/", handleIndex)
	http.HandleFunc("/alpaca1", handleAlpaca1)
	http.HandleFunc("/alpaca2", handleAlpaca2)
	http.HandleFunc("/alpaca_flag", handleFlag)
	http.HandleFunc("/http_103_code", handle103)
	http.ListenAndServe(":8080", nil)
}

// Not sure if it's lazyness or pleasure of doing wrong thingsâ€¦
const alpaca1 = ""

const alpaca2 = ""
